    "contracts/roles/Role.sol": {
      "content": "// contracts/Whitelist.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "../registry/IAddressRegistry.sol";
import "../crowdsale/ICrowdsaleFactory.sol";


// debug
import "hardhat/console.sol";

contract Roles is AccessControl {
    // Admin roles
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 public constant MANAGER_ROLE = keccak256("MANAGER_ROLE");
    bytes32 public constant WHITELISTER_ROLE = keccak256("WHITELISTER_ROLE");

    // User roles
    bytes32 public constant WHITELISTED_ROLE = keccak256("WHITELISTED_ROLE");
    bytes32 public constant BLOCKLISTED_INVEST_ROLE = keccak256("BLOCKLISTED_INVEST_ROLE");
    bytes32 public constant BLOCKLISTED_TRANSFER_ROLE = keccak256("BLOCKLISTED_TRANSFER_ROLE");

    address addressRegistry;

    event SetNewRegistryAddress(address newAddress);

    constructor(address admin, address manager, address whitelister) {
        _grantRole(DEFAULT_ADMIN_ROLE, admin);
        _grantRole(ADMIN_ROLE, admin);
        _grantRole(MANAGER_ROLE, manager);
        _grantRole(WHITELISTER_ROLE, whitelister);
    }

    function grantWhitelistedRole(address investor)
        external
        onlyRole(WHITELISTER_ROLE)
    {
        require(
            !hasRole(WHITELISTED_ROLE, investor),
            "User is already whitelisted"
        );
        _grantRole(WHITELISTED_ROLE, investor);
    }

    function revokeWhitelistedRole(address investor)
        external
        onlyRole(WHITELISTER_ROLE)
    {
        require(
            hasRole(WHITELISTED_ROLE, investor),
            "User is not whitelisted"
        );
        _revokeRole(WHITELISTED_ROLE, investor);
    }

    function blocklistFromTransfer(address investor)
        external
        onlyRole(MANAGER_ROLE)
    {
        require(
            !hasRole(BLOCKLISTED_TRANSFER_ROLE, investor),
            "User is already blocklisted from transfer"
        );
        _grantRole(BLOCKLISTED_TRANSFER_ROLE, investor);
    }

    function unBlocklistFromTransfer(address investor)
        external
        onlyRole(MANAGER_ROLE)
    {
        require(
            hasRole(BLOCKLISTED_TRANSFER_ROLE, investor),
            "User is not blocklisted from transfer"
        );
        _revokeRole(BLOCKLISTED_TRANSFER_ROLE, investor);
    }

    function blocklistFromInvest(address investor)
        external
    {
        address factory = IAddressRegistry(addressRegistry).getCrowdsaleFactAddr();
        bool isCrowdsaleExists = ICrowdsaleFactory(factory).isCrowdsaleExists(msg.sender);
        bool isManager = hasRole(MANAGER_ROLE, msg.sender);

        require(isCrowdsaleExists || isManager, "Sender is not allowed");
        require(
            !hasRole(BLOCKLISTED_INVEST_ROLE, investor),
            "User is already blocklisted from invest"
        );
        _grantRole(BLOCKLISTED_INVEST_ROLE, investor);
    }

    function unBlockListFromInvest(address investor)
        external
        onlyRole(MANAGER_ROLE)
    {
        require(
            hasRole(BLOCKLISTED_INVEST_ROLE, investor),
            "User is not blocklisted from invest"
        );
        _revokeRole(BLOCKLISTED_INVEST_ROLE, investor);
    }

    function setRegistryAddress(address newAddress)
        external
        onlyRole(MANAGER_ROLE)
    {
        require(newAddress != address(0));
        addressRegistry = newAddress;
        emit SetNewRegistryAddress(newAddress);
    }

}"
